// Sidebar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemText, Backdrop } from '@mui/material';

function Sidebar() {
  return (
    <Drawer anchor="left" open={true} sx={{ width: '250px', backdropFilter: 'none' }}>
      <List sx={{ backgroundColor: 'black', color: 'white' }}>
        <ListItem button component={Link} to="/">
          <ListItemText primary="Home" />
        </ListItem>
        <ListItem button component={Link} to="/profile">
          <ListItemText primary="Profile" />
        </ListItem>
      </List>
      {/* Disable the backdrop filter */}
      <Backdrop sx={{ backgroundColor: 'rgba(0, 0, 0, 0.5)', backdropFilter: 'none' }} open={true} />
    </Drawer>
  );
}

export default Sidebar;
